import React from "react";
import PokemonStats from "./PokemonStats";

type Props = {};

const PokemonDetailsStats = () => {
  return (
    <>
      <h1 className="font-semibold text-lg mb-4">Base Stats</h1>
      <ul>
        <PokemonStats title="HP" min={40} max={40} />
        <PokemonStats title="Attack" min={40} max={40} />
        <PokemonStats title="Defense" min={40} max={40} />
        <PokemonStats title="Sp.Atk" min={40} max={40} />
        <PokemonStats title="Sp.Def" min={40} max={40} />
        <PokemonStats title="Speed" min={40} max={40} />
      </ul>
      <p className="mt-10 mb-6 text-darkGray font-medium">
        Min & Max values are calculated for level 100 Pokemon. Minimum values
        are based on 0 EVs & 0 IVs, meanwhile Maximum values are based on 252
        EVs & 31 IVs.
      </p>
    </>
  );
};

export default PokemonDetailsStats;
